INSERT INTO `datablender_comments` (`ID`, `id_mall`, `id_comment`, `name`, `comment`, `rating`, `datablender_rating`, `datablender_emotional_terms`, `google_traduct`, `comment_date`) VALUES
(1, 1, 'ChdDSUhNMG9nS0VJQ0FnSURja01XRnVnRRABGhZJTWJEVFFlRmo2VldCVVNob0t5WUd3', 'RosaAlessandra Delpiano', 'Attention,les toilettes publiques ouvrent à 11h!!(La personne que s\'occupe du nettoyage n\'arrive pas avant).Les magasins refusent de vous dépanner en vous servant de leur,alors si vous faites la queue(et en ce moment c\'est fort possible....) pendant un moment, et vous arrivez tôt, ne buvez pas trop.....', 2, -0.8, 0, 0, 'il y a une semaine'),
(2, 1, 'ChdDSUhNMG9nS0VJQ0FnSURzaXB1STh3RRABGhZtc0I4ZUNSU252WVJ2aWtfNVg2T2ZB', 'Antoine Planta', 'grand parking sécurisé  belle zones dommage que lors des match les boutiques ferme. la salle de sport est pas mal a voir a l avenir avec l ouverture du fameux ikea je pense que se sera  super lieux bien desservit pour le moment', 4, 0.5, 0, 0, 'il y a 2 mois'),
(3, 1, 'ChdDSUhNMG9nS0VJQ0FnSURja011U3FRRRABGhZrMWFudVVISW5TSkN1cnlEWnRVcXFB', 'Alexis M', 'C est bien mais il y a peu de magasin, mais quand il y aura Ikea ça va être mieux', 4, 0, 0, 0, 'il y a une semaine'),
(4, 1, 'ChdDSUhNMG9nS0VJQ0FnSURNdDhDbHdBRRABGhZfbGZ6eF82bDRXRUVoTndLU2tCSWdn', 'janusthe22', 'Vaste choix de produits bios et italiens. Pôle restauration sympathique même si, pour y manger régulièrement, il mériterait de varier un peu ses propositions.\nPrix moyens, mériteraient une légère baisse pour un Leclerc...', 3, 0.3, 0, 0, 'il y a 4 mois'),
(5, 1, 'ChdDSUhNMG9nS0VJQ0FnSURNcWU3WHh3RRABGhZJTVVhQW10dDBKQ2U4Qlh0eWpBa25n', 'Emilie Biras', 'Pas de toilettes publiques, regrettable. Tout comme un simple panneau pour indiquer les magasins (à moins que je l\'ai raté).\nCependant propre et neuf , agréable.', 3, 0, 0, 0, 'il y a 4 mois'),
(6, 1, 'ChZDSUhNMG9nS0VJQ0FnSUNzanZuTk9nEAEaFmhadEJ4bjkwWWZkYmxqSzFZWmZDVkE', 'noé karine', 'Bof bof bof  il n\'y a pas beaucoup de magasin ... Environnement très moyen !!! Pas vraiment favorable à la promenade et à la détente. Rien à voir avec polygone Riviera.', 2, -0.8, 0, 0, 'il y a 3 mois'),
(7, 1, 'ChZDSUhNMG9nS0VJQ0FnSUNzdjhQaWJREAEaFk5ZY2dCRzREcVMxNlg2OHBqbWIxZGc', 'Roxane Torre', 'Facile d\'accès avec Grand parking.  Mais le lieu manque de dynamisme.  Dommage', 3, -0.1, 0, 0, 'il y a 3 mois'),
(8, 1, 'ChZDSUhNMG9nS0VJQ0FnSUNNNi1tZERREAEaFktObzRZN21qdGpnU3dKdURUcVd5NVE', 'Claudine Erkiet', 'Accès facile, parking gratuit. Le magasin Action ouvert il y a 8 jours est très al organisé, file d\'attente sur le trottoir pour entrer et à l\'intérieur les rayons sont vides ! Celui de Fréjus est bien mieux...', 3, 0, 0, 0, 'il y a 5 mois'),
(9, 1, 'ChdDSUhNMG9nS0VJQ0FnSURzbW9yX2hnRRABGhZldDEtVjVtTWpkR2p5cTFGMGdwa2Nn', 'Joseline Diatta', 'Boutiques sympathiques, j\'espère qu\'il y aura d\'autres enseignes (j\'attends Ikea avec impatience) dommage que tout ne soit pas ouvert le dimanche. A eviter les jours de match, c\'est toujours le désordre !', 4, 0, 0, 0, 'il y a 2 mois'),
(10, 1, 'ChZDSUhNMG9nS0VJQ0FnSURNX0tETkpREAEaFjBBLURTSTE2c1pSeU1mbUMwR1pDclE', 'Joelle Francois', 'A bannir les jours de match!!! J\'ai attendu 10 minutes au milieu de la route pour tourner vers le parking. Les agents de sécurité ne m\'ont jamais laissé y accéder ! De plus j\'ai vu qu\'ils contrôlaient les coffres de voiture donc une file …', 1, -0.3, 0, 0, 'il y a 5 mois'),
(11, 1, 'ChZDSUhNMG9nS0VJQ0FnSURzeXJLaUlnEAEaFlR4aDlNeGhFeHhybEdORERNMTdVNVE', 'Manon N', 'Le lieu est agréable mais le parking n\'est pas très pratique... Il ne faut absolument pas venir lorsqu\'il y a un match de prévu !!', 3, -0.4, 0, 0, 'il y a 2 mois'),
(12, 1, 'ChZDSUhNMG9nS0VJQ0FnSUNNNWRfY0NREAEaFnVZMjVpNnVoeFluWXptaF9ob19mYVE', 'Liliane Mahieddine', 'très bien agencé  ,mais l ouverture  du magasin  Action ,mauvaise  organisation  ,pas de cordon pour délimiter  la file d\'attente  !!! de faite ,des débordement  ,de tous les côtés  ,manque de  civisme et d éducation  !!! ,très pénible, si l organisation  avait été  mieux pensée, cela aurait pu être  évité  !!', 5, -0.7, 0, 0, 'il y a 5 mois'),
(13, 1, 'ChdDSUhNMG9nS0VJQ0FnSURzaWFxRTJnRRABGhYyLTZMcjRISllfZS1IdWE1RGlqUlZn', 'Robert B', 'Avantage : l\'accès à pied est facilité. Bien desservi par le tram (ligne 3, arrêt Stade ou Saint Isidore).', 3, 0.6, 0, 0, 'il y a 2 mois'),
(14, 1, 'ChdDSUhNMG9nS0VJQ0FnSURNbDdxRjBRRRABGhZGSGNGZzRhUXRFSVRsODZtcGZNc1NB', 'as fig', 'Lieu sympa avec quelques enseignes.j ai hâte d en découvrir d autre prochainement.\nIn peut y manger , faire du sport , les boutiques. Manque encore d organisation à l ouverture de magasin ou d activités.', 4, 0.3, 0, 0, 'il y a 4 mois'),
(15, 1, 'ChZDSUhNMG9nS0VJQ0FnSUNNalludURnEAEaFnBTNXZjelBRRFl0bVNnSEdmaEhaMVE', 'Laurent Hugues', 'Accès long et compliqué des l\'ouverture alors que le centre commercial n\'est pas surchargé. Peu de clients, peu de personnel, beaucoup de temps perdu pour pas grand chose. Fonctionnement à revoir.', 1, -0.8, 0, 0, 'il y a 5 mois'),
(16, 1, 'ChdDSUhNMG9nS0VJQ0FnSUNjbGJXMXhRRRABGhZGX1RKcGlad0pQUXl0NWtjcUVDV1B3', 'Alicia Verdu', 'Action nous y sommes allés avec des amis nous ne connaissions pas magasin très sympa différents articles on y trouve de tout aussi bien alimentaires, Textiles, vaisselles, fournitures scolaires, produits ménagers ect ect.... à des prix très abordables nous y retournerons ', 4, 0.9, 0, 0, 'il y a 2 mois'),
(17, 1, 'ChZDSUhNMG9nS0VJQ0FnSURzNk9US0VREAEaFlRwUFJvRjBzM3J1RHJndXN2d2hYREE', 'Ruben Valencia Sullice', 'Première et dernière fois. Pas de parking à cause du match j\'imagine..on s\'est fait embarquer la voiture en juste une demie heure qu\'on était faite un achat urgent. Mais on n\'y retourne plus.', 1, -0.8, 0, 0, 'il y a 2 mois'),
(18, 1, 'ChZDSUhNMG9nS0VJQ0FnSURzcVA3R1dREAEaFkZORWs1VkYxMmZzaFpiNTVYZWgyNXc', 'jean-louis Milani', 'Un peu loin du centre ville mais plus accessible aujourd\'hui grâce à la ligne 3 du Tram', 3, 0.5, 0, 0, 'il y a 3 mois'),
