(21, 1, 'ChZDSUhNMG9nS0VJQ0FnSUNNemZMVlVnEAEaFmpfQVRKR3R6QUZtVmRNTUJ2TTdXMmc', 'Alain Muret', 'La moitié des magasins encore inexploitée. A revoir après ouverture complète. Boulanger et jouets club très bien.', 3, 0, 0, 0, 'il y a 5 mois'),
(22, 1, 'ChZDSUhNMG9nS0VJQ0FnSUMwX29uZGRnEAEaFjlCbkRySGd1LVZKeWcxbGloTS1aQ3c', 'gladiator06m', 'Une honte ! Nous sommes aller un jour de match en famille on nous laisse rentrer on vérifie notre coffre (question de sécurité) jusque là tout va bien on fait nos course et au moment de récupérer notre voiture, on nous annonce ouvertement …', 1, -0.5, 0, 0, 'il y a 7 mois'),
