(29, 1, 'ChZDSUhNMG9nS0VJQ0FnSUNNdTZ5N1RnEAEaFnVsX2EzZFV3VEtCOUwtdWZ5Q3VpSXc', 'Pitchoun Pitchoun', 'Action je ne comprends pas pourquoi il a ouvert ce magasin 3 fois j’y vais et 3 fois c le désert dans les rayons je ne comprends pas je pose la question à la caissière pourquoi y’a pas de réassort elle me dit que oui j’ose qui n’est …', 1, -0.7, 0, 0, 'il y a 5 mois'),
