(34, 1, 'ChdDSUhNMG9nS0VJQ0FnSURNdU0taTl3RRABGhZ4bmdyUlFIMUtIakhyeHhNa2xldjdR', 'Pascale Canadas palamara', 'Vraiment très déçu de mon passage. Seul point  Positif de ma visite grand  parking en sous sol gratuit. Peu d\'enseigne 14 à ce jour. Lieu moyennement entretenu . Mais La plus grosse déception est le magasin action qui est également à dignes …', 1, -0.3, 0, 0, 'il y a 5 mois'),
(35, 1, 'ChdDSUhNMG9nS0VJQ0FnSURNeU0zSnFRRRABGhZHN0xmNHdoaGtoSVl0QmRkNThqNUFB', 'soumia ben', 'Trop de monde, saletés par tout, j\'ai pas vu d\'agent de sécurité ou d\'agent de propreté....les toilettes catastrophiques, la queue pour entrer à certains magasins...après il y a pas mal de magasins intéressants mais dommage mauvaise organisation de la part du centre et des gens aussi', 2, -0.5, 0, 0, 'il y a 5 mois'),
(36, 1, 'ChZDSUhNMG9nS0VJQ0FnSURzaFBuSmN3EAEaFlBQYWllVlB1MC1jbXY2Z0VoMlc5OUE', 'Charles Benzaken', 'Ça commence à être connu, Un magasin Leclerc Bio et Italien superbe plus besoin d\'aller en Italie. Prix très correct et de bonne qualité Parking souterrain gratuit, sous le stade Allianz Riviera, à voir.', 3, 0.9, 0, 0, 'il y a 2 mois'),
(37, 1, 'ChdDSUhNMG9nS0VJQ0FnSUNNdWVqSHRBRRABGhZaaHhyb0FqSzBLVC1lNE51TmswTlhn', 'LOIS B.', 'Très bon centre commercial. Magasins de meubles, d électroménager, salle de sport et supermarché. Que demander de plus. Facile pour se garer et à côté de l autoroute.', 5, 0.8, 0, 0, 'il y a 5 mois'),
(38, 1, 'ChdDSUhNMG9nS0VJQ0FnSUNzcnVtbnFRRRABGhZXRDlNRGNVeFhiVjAxb0tDZ2lIdkRn', 'Odile thewood', 'Il manque encore pour cette gallerie commerciale en plein air d\'un lieu de consommation sur le pouce à prix abordable. Pour un petit goûter en famille, genre brioche dorée, sandwicherie. Car le restaurant Happy dîners reste un peu cher pour ce genre de consommation rapide.', 3, 0, 0, 0, 'il y a 3 mois'),
(39, 1, 'ChZDSUhNMG9nS0VJQ0FnSUNzMExQV1R3EAEaFjdnbDZBVDdNc1BmM3JtYldndHJIcnc', 'Annie Malzac', 'C\'était pour le nouveau magasin Action, a proximité de Gifi. Le parking en sous-sol est très pratique.', 4, 0.5, 0, 0, 'il y a 4 mois'),
