(42, 1, 'ChdDSUhNMG9nS0VJQ0FnSURVajRyV2d3RRABGhZVYlIxSldPRkRMU3NCRnZEb2lNcDN3', 'H Z', 'Ce centre est de plus en plus vivant . J\'ai toujours aimé m\'y rendre car très facile d\'accès . Manger au bio Italien est une excellente expérience et je recommande fortement cet endroit , le personnel est toujours très sympa . J\'ajouterai une étoile quand le centre sera exploité entièrement .', 4, 0.5, 0, 0, 'il y a 8 mois'),
