(51, 1, 'ChZDSUhNMG9nS0VJQ0FnSUNzcWVYaE9BEAEaFl9vbGtPay1WQ21KNHAwMWJ5aHpsMGc', 'Eïwary', 'Petit centre commercial sympathique.\nStationnement en sous sol gratuit.\nQuelques enseignes intéressantes présentes sur place comme Boulanger, Action, Gifi ou Memphis Cofee pour ne citer qu\'eux.\nLe centre est situé juste derrière l\'Allianz Riviera.\nLe 1 er Ikea des Alpes Maritimes ouvrira aussi ses portes dans quelques mois !', 4, 0.5, 0, 0, 'il y a 3 mois'),
